import React, {useState} from 'react';
import users from '../users.json';


const UsersBox = () => {


    const ChageUser = () => alert ("cambiar Usuario")
    return (
        <div>
            <h1> {users[0].name.title} {users[0].name.first} {users[0].name.last} </h1>
         
            <img src={users[0].picture.medium}/>

            
           <div><button onClick={ChageUser} >Cambiar usuario</button></div>
          
        </div>
    );
};

export default UsersBox;
